css:
@namespace url(http://www.w3.org/1999/xhtml);

@-moz-document domain("wikipedia.org"), domain("wikimedia.org") {
body{overflow-x:hidden !important}
body.mediawiki  {font-family:Minion Pro, Georgia, "Times New Roman", serif !important; line-height: 1.5em !important; background:#111!important; color: #dbdbdb!important; font-size:18px!important; }
a:link.new { color:#dd0000 !important; } /* red links */
.mediawiki #content {border: none !important; background:#eee!important; color:#444!important; font-size:24px !important; padding:3% 12% !important; margin:0!important; margin-top:3%!important; }
.mediawiki a {color:#333!important; border-bottom: 1px dotted #777!important;}
.mediawiki a.image {border:none!important;}
.mediawiki a img {border:none!important;}
.mediawiki #column-content{margin:0!important;}
.mediawiki .pBody {background-color:transparent!important; border:none!important; padding:0!important; text-transform:lowercase;}
.mediawiki .infobox, .vevent,#contentSub, table.navbox, .toc, .catlinks, .metadata,.plainlinks,.mbox-small, .noprint, .tright, .portal, .infobox, .geography, .vcard{-moz-border-radius:5px !important;-webkit-border-radius:5px!important;}
.mediawiki .wikitable {margin:10px!important; min-width:100px;}
.mediawiki .summary {background-color:#DDD!important;}
.mediawiki .ambox {text-align: left !important; margin:0!important; border-left:10px solid #AAA!important; -moz-border-radius:5px;-webkit-border-radius:5px; margin-bottom:10px !important;}
.mediawiki #p-logo, #p-interaction, #n-contents, #footer,#p-tb, #n-currentevents, #p-personal, .editsection,#siteNotice, #p-search h5,#p-navigation h5, #siteSub, #p-search input.searchButton,#mw-page-base,#ca-nstab-main,#n-featuredcontent,#searchButton {display:none!important;}
.mediawiki .navbox-title {background:#eee!important;}
.mediawiki h2 {clear:left; margin-top: 3%;}
.mediawiki .suggestions {position:absolute;right:13px!important; top:35px!important; -moz-border-radius:30px!important;width:auto!important;}
.mediawiki .suggestions-results {border:1px solid #000!important;padding:5px!important;width:auto!important;background:rgba(0,0,0,0.9)!important;color:#dbdbdb!important;}
.mediawiki .suggestions-result,.suggestions-special .special-query,.suggestions-special .special-label{color:#dbdbdb!important; text-align:right!important;}
.mediawiki .suggestions-special {-moz-border-radius:10px!important;-moz-border-radius-topleft:0!important; -moz-border-radius-topright:0!important;margin-top:0px!important;border:1px solid #000!important;padding:5px!important;border-top:none!important;width:auto!important;background:rgba(0,0,0,0.9)!important;color:#dbdbdb!important;}
.mediawiki .suggestions-results .suggestions-result-current {background:none!important;color:#6699CC!important;}
.mediawiki .suggestions-result-current,.suggestions-result-current .special-query,.suggestions-result-current .special-label  {color:#6699CC!important;}

.mediawiki #mw-panel.collapsible-nav div.portal {margin:0!important;}
.mediawiki div#mw-panel {position:static!important;width:100%!important; clear:both!important;margin:0!important;padding:0!important;padding-top:0!important;height:auto!important; top:0!important;background:none!important;}
.mediawiki div#mw-panel div.portal div.body {background:none!important;}
.mediawiki #p-lang {background:none!important;width:100%!important;margin:0!important;padding:0!important;position:relative!important; bottom:0!important; left:0!important; display:block!important;margin:0!important;padding:0!important;top:-80px!important;}
.mediawiki #p-lang h5 {width:100%!important;border-bottom:1px solid #333!important; color:#dbdbdb!important;}
.mediawiki #p-lang .body{margin:0!important;padding:0!important;background:none!important;}
.mediawiki #p-lang .body ul {padding:10px!important;}
.mediawiki #p-lang ul li {float:left!important; margin-left:10px!important;}
.mediawiki #p-lang ul li a {color:#ccc!important;}
.mediawiki #coordinates {top:-20px!important;}
.mediawiki #p-coll-print_export{left:165px!important;background:none!important;position:absolute!important;top:5px!important; margin:0!important; padding:0!important;}
/*.mediawiki #p-coll-print_export .body {padding:0!important; margin:0!important;} with js */
.mediawiki #p-coll-print_export .body {padding:0!important; margin:0!important; display: none!important;}
.mediawiki #p-coll-print_export:hover .body {display: block!important;}
.mediawiki #p-coll-print_export .body ul{padding:0!important; margin:0!important;background:#fafafa!important; padding:5px!important;border:1px solid #aaa;margin-top:6px!important;border-top:none!important;left:18px;-moz-box-shadow:0 0 10px rgba(0,0,0,0.5); -moz-border-radius-bottomright:5px;-moz-border-radius-bottomleft:5px;}
.mediawiki #p-coll-print_export h5 {background:none!important;color:#aaa!important;text-transform:lowercase!important;padding:0!important; margin:0!important;}
.mediawiki #p-namespaces ul{position:absolute!important;top:-36px!important;left:-50px!important;}
.mediawiki div.vectorTabs .selected a span{font-weight:bold!important; color:#CCC!important;}
.mediawiki div#mw-head {position:static!important;display:inline !important;}
.mediawiki #p-navigation {position:static !important; display:inline !important;}
.mediawiki #p-namespaces {position:static!important;display:inline !important;}

.mediawiki div.vectorTabs {background:none!important;}
.mediawiki div.vectorTabs ul {float:none!important;background:none!important;position:absolute !important;z-index:3000!important;list-style-type:none !important; list-style-image:none !important;top:5px!important;left:0px!important; height:auto!important;}
.mediawiki div.vectorTabs ul li {background:transparent!important;list-style-type:none !important; list-style-image:none !important; float:left!important; margin-left:10px!important;height:auto!important;line-height:1em!important;text-transform:lowercase!important;}
.mediawiki div.vectorTabs ul li.selected {background:none!important;}

.mediawiki div.vectorTabs ul li a span {padding-top:0!important;color:#aaa!important;border-bottom:none !important;}

.mediawiki #p-navigation ul {position:absolute !important; top:2px !important; right:215px !important; list-style-type:none !important;list-style-image:none !important; float:left;}
.mediawiki #p-navigation ul li {list-style-type:none !important; list-style-image:none !important; float:left; margin-left:5px!important;}
.mediawiki #p-navigation ul li a {border-bottom-width:4px !important; color: #aaa !important;}
.mediawiki #p-cactions li a {padding:8px !important;}
.mediawiki #p-search {position:static!important;}
.mediawiki #searchform {display:block !important; width:200px!important; position:absolute!important; right:0px!important;} 
.mediawiki #simpleSearch {position:absolute!important; top:0px!important;}
.mediawiki li#ca-talk {margin-right:0 !important;}
.mediawiki h1#firstHeading {border:none !important; font-style:italic; font-size:2.5em !important; color:#111!important; margin-bottom:3% !important; line-height:1em !important;padding-top:5px!important;padding-bottom:0px!important;overflow:visible!important;}
.mediawiki #column-content {float:none !important; width:auto!important;}
.mediawiki #searchBody {padding:0!important; margin:0!important; border:0 !important; background:none!important;}
.mediawiki #bodyContent p {line-height:1.8em !important;}

.mediawiki input#searchInput {position:absolute!important;top:1px!important;width:158px !important; right:230px!important;margin:0!important; font-family:Georgia, "Times New Roman", serif!important;font-size:11px!important; color:#555!important;background:#fafafa url(data:image/png;base64,) no-repeat 5px 3px!important; padding-left:22px!important;padding-right:10px!important;-moz-border-radius:30px!important;}

.mediawiki #simpleSearch {margin:0!important;margin-top:0!important; background:none!important; border:none!important;}
.mediawiki #p-cactions li {border:0 !important; background:none !important; background-color:transparent !important;}
.mediawiki #p-cactions li a {border:0 !important; background:none !important; background-color:transparent !important; color:#dbdbdb !important; }
.mediawiki #p-cactions {left: -22px !important; top: 7px !important;}
.mediawiki #simpleSearch label {padding:0!important;top:-3px!important; left:22px!important; font-size:11px!important; display:none!important;}
.mediawiki #searchInputSuggest {right:0px !important;}
.mediawiki .dablink {background-color:#DDD!important; color:#222!important; padding:5px 10px !important; -moz-border-radius:5px; margin-bottom:3% !important;}

.mediawiki #toc {background-color:transparent !important;}
.mediawiki #column-one {padding-top:0 !important;}
.mediawiki #contentSubs, #contentSub2s {margin:0px!important;margin-bottom:5px!important; margin-top:-10px; text-indent:0!important;font-size:10px!important;}
.mediawiki #contentSub, #contentSub2 {position:absolute!important; top:-50px!important; right:15px!important;}
.mediawiki #contentSub, #contentSub a {color:#555!important;}
.mediawiki table {background:transparent!important;}

.mediawiki div.vectorTabs ul li a,li#n-mainpage-description a,li#n-randompage a,li#n-sitesupport a{opacity:0.6;display:block;background:transparent!important;background-image:url(data:image/png;base64,)!important;height:16px!important;width:16px!important;overflow:hidden!important;text-indent:-9999px!important;padding:0!important;border-bottom:none !important;border:5px solid #111!important; }
.mediawiki div.vectorTabs ul li a:hover,li#n-mainpage-description a:hover,li#n-randompage a:hover,li#n-sitesupport a:hover {opacity:1;border-color:#333!important;background-color:#333!important;}
.mediawiki li#ca-view a{background-position:0px 16px!important;}
.mediawiki li#ca-view a:hover{background-position:0px 0px!important;}
.mediawiki li#ca-edit a, .mediawiki li#ca-viewsource a{background-position:-80px 16px!important;}
.mediawiki li#ca-edit a:hover,.mediawiki li#ca-viewsource a:hover{background-position:-80px 0px!important;}
.mediawiki li#ca-history a{background-position:-48px 16px!important;}
.mediawiki li#ca-history a:hover{background-position:-48px 0px!important;}
.mediawiki li#ca-talk a{background-position:-16px 16px!important;}
.mediawiki li#ca-talk a:hover{background-position:-16px 0px!important;}
.mediawiki li#n-mainpage-description a{background-position:-64px 15px!important;}
.mediawiki li#n-mainpage-description a:hover{background-position:-64px -1px!important;}
.mediawiki li#n-randompage a{background-position:-112px 16px!important;}
.mediawiki li#n-randompage a:hover{background-position:-112px -1px!important;}
.mediawiki li#n-sitesupport a{background-position:-128px 16px!important;}
.mediawiki li#n-sitesupport a:hover{background-position:-128px 0px!important;}

[href]:visited, a [href]:visited * { color: purple !important; } 
a[href]:link, a[href]:link * { color: blue ! important; } 
a[href], a[href] * { text-decoration: underline ! important; } 
}
